import React, {useState, useEffect} from 'react';
import axios from 'axios';
import { useParams } from 'react-router-dom';
const {id} = useParams();

const DeleteUser = () => {

    const [user, setUser] = useState([]);
    const {id} = useParams();

    useEffect(() =>{
        axios.get(`/user/get/${id}`)
        .then(response =>{
            setUser(response.data);
        })
    }, [])

  return (
    <div>DeleteUser</div>
  )
}

export default DeleteUser
